import React from 'react';
import * as animation from '../Assets/animation.jpg';
import { Grid, Item, Header, Image, Icon} from 'semantic-ui-react';


class LandingPage extends React.Component {
    render () {
		return (
            <React.Fragment>
                <Grid>
                    <Grid.Row>
                    <Header as='h3' style={{'background-color': '#282c34'}}>
                        <Icon name='home' style={{'align': 'left'}}/>
                    </Header>

                    </Grid.Row>
                    <Grid.Row>

                    </Grid.Row>
                </Grid>
            </React.Fragment>
        );
    }
}

export default LandingPage
